import React, { useEffect, useState } from 'react';
import { makeStyles } from '@material-ui/core/styles';
import TextField from '@material-ui/core/TextField';
import { Container, Paper, Button, Typography, Grid } from '@material-ui/core';

const useStyles = makeStyles((theme) => ({
  root: {
    '& > *': {
      margin: theme.spacing(1),
    },
  },
  paper: {
    padding: theme.spacing(4),
    margin: theme.spacing(2, 'auto'),
    maxWidth: 600,
  },
  formControl: {
    margin: theme.spacing(1),
    width: '100%',
  },
  button: {
    marginTop: theme.spacing(2),
  },
  studentCard: {
    margin: theme.spacing(1),
    padding: theme.spacing(2),
    textAlign: 'left',
  },
  header: {
    marginBottom: theme.spacing(2),
    textAlign: 'center',
  },
}));

export default function Student() {
  const classes = useStyles();
  const [name, setName] = useState('');
  const [address, setAddress] = useState('');
  const [students, setStudents] = useState([]);

  const handleClick = (e) => {
    e.preventDefault();
    const student = { name, address };
    fetch('http://localhost:8080/student/add', {
      method: 'POST',
      headers: { 'Content-Type': 'application/json' },
      body: JSON.stringify(student),
    }).then(() => {
      console.log('New Student added');
      fetchStudents(); // Refresh the list after adding
    });
  };

  const fetchStudents = () => {
    fetch('http://localhost:8080/student/getAll')
      .then((res) => res.json())
      .then((result) => {
        setStudents(result);
      });
  };

  useEffect(() => {
    fetchStudents(); // Fetch students on initial render
  }, []);

  const handleDeleteById = (id) => {
    fetch(`http://localhost:8080/student/delete/${id}`, {
      method: 'DELETE',
    }).then(() => {
      console.log(`Student with ID ${id} deleted`);
      fetchStudents(); // Refresh the list after deleting
    });
  };

  const handleDeleteAll = () => {
    fetch('http://localhost:8080/student/deleteAll', {
      method: 'DELETE',
    }).then(() => {
      console.log('All students deleted');
      setStudents([]); // Clear the local state after deleting all
    });
  };

  return (
    <Container>
      <Paper elevation={3} className={classes.paper}>
        <Typography variant="h4" color="primary" className={classes.header}>
          Add Student
        </Typography>

        <form className={classes.root} noValidate autoComplete="off">
          <TextField
            label="Student Name"
            variant="outlined"
            className={classes.formControl}
            value={name}
            onChange={(e) => setName(e.target.value)}
          />
          <TextField
            label="Student Address"
            variant="outlined"
            className={classes.formControl}
            value={address}
            onChange={(e) => setAddress(e.target.value)}
          />
          <Button
            variant="contained"
            color="primary"
            onClick={handleClick}
            className={classes.button}
          >
            Submit
          </Button>
        </form>
      </Paper>

      <Typography variant="h4" color="primary" className={classes.header}>
        Students
      </Typography>

      <Paper elevation={3} className={classes.paper}>
        {students.length === 0 ? (
          <Typography variant="body1" align="center">
            No students found.
          </Typography>
        ) : (
          students.map((student) => (
            <Paper
              elevation={4}
              className={classes.studentCard}
              key={student.id}
            >
              <Typography variant="h6">Id: {student.id}</Typography>
              <Typography variant="body1">Name: {student.name}</Typography>
              <Typography variant="body1">Address: {student.address}</Typography>
              <Button
                variant="contained"
                color="secondary"
                onClick={() => handleDeleteById(student.id)}
                style={{ marginTop: '10px' }}
              >
                Delete
              </Button>
            </Paper>
          ))
        )}
        {students.length > 0 && (
          <Button
            variant="contained"
            color="secondary"
            onClick={handleDeleteAll}
            className={classes.button}
          >
            Delete All
          </Button>
        )}
      </Paper>
    </Container>
  );
}
